import './styles.css';
import TypeAhead from './typeahead';

const Step1 = () => {
  return (
    <div>
      <h2>Step1</h2>
      <TypeAhead></TypeAhead>
      <ul>
        <li></li>
      </ul>
    </div>
  );
}
export default Step1;
